--
-- Definition of function `ft_GenerarCodigo`
--

DROP FUNCTION IF EXISTS `ft_GenerarCodigo`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` FUNCTION `ft_GenerarCodigo`(Codigo CHAR(14), Tabla CHAR(2)) RETURNS char(20) CHARSET latin1 COLLATE latin1_spanish_ci
BEGIN
	
SET Codigo = CONVERT(Codigo USING latin1) COLLATE latin1_spanish_ci;
SET  Tabla = CONVERT(Tabla USING latin1) COLLATE latin1_spanish_ci;

SET @ArrayIndex = 4;
SET Codigo =  CONCAT(Codigo,'-', Tabla);

SET @CodCompleto = (
SELECT
CASE 
WHEN Tabla = 'PL' THEN
   (SELECT codplanificacion FROM planificacion WHERE codplanificacion LIKE CONCAT(Codigo,'%') ORDER BY codplanificacion DESC LIMIT 1)
WHEN Tabla = 'OB' THEN
   (SELECT codobjetivo FROM objetivos WHERE codobjetivo LIKE CONCAT(Codigo,'%') ORDER BY codobjetivo DESC LIMIT 1)
WHEN Tabla = 'AC' THEN
   (SELECT codaccion FROM accionespropuestas WHERE codaccion LIKE CONCAT(Codigo,'%') ORDER BY codaccion DESC LIMIT 1)
WHEN Tabla = 'ME' THEN
   (SELECT codmejora FROM mejoras WHERE codmejora LIKE CONCAT(Codigo,'%') ORDER BY codmejora DESC LIMIT 1)

END Cod);
/*
SUBSTRING_INDEX(string, delim, n) returns the first n
SUBSTRING_INDEX(string, delim, -1) returns the last only
REGEXP '((delim).*){n}' checks if there are n delimiters (i.e. you are in bounds)
*/

SET @Resultado = (SELECT CASE 
    WHEN @CodCompleto REGEXP CONCAT('((-).*){',@ArrayIndex,'}')
    THEN CONCAT(Codigo, '-', CONCAT(REPEAT('0', 5-LENGTH(CAST(SUBSTRING_INDEX(SUBSTRING_INDEX(@CodCompleto,'-',@ArrayIndex+1),'-',-1) AS UNSIGNED)+1 )), CAST(SUBSTRING_INDEX(SUBSTRING_INDEX(@CodCompleto,'-',@ArrayIndex+1),'-',-1) AS UNSIGNED)+1 ))
    ELSE CONCAT(Codigo, '-', CONCAT(REPEAT('0', 5-LENGTH(1)), 1))
END AS Result);

RETURN @Resultado;




END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_AprobarPlanificacion`
--

DROP PROCEDURE IF EXISTS `sp_AprobarPlanificacion`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_AprobarPlanificacion`(CodPlan CHAR(20))
BEGIN
  UPDATE planificacion SET
  codestado='200'
	WHERE codplanificacion=CONVERT(CodPlan USING latin1) COLLATE latin1_spanish_ci;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

