--
-- Definition of procedure `sp_EditarClave`
--

DROP PROCEDURE IF EXISTS `sp_EditarClave`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_EditarClave`(Correo VARCHAR(50), Pass VARCHAR(32))
BEGIN
  UPDATE usuarios SET
  password=CONVERT(Pass USING latin1) COLLATE latin1_spanish_ci
	WHERE email=CONVERT(Correo USING latin1) COLLATE latin1_spanish_ci
  AND activo = 1
  LIMIT 1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_EditarEmpleado`
--

DROP PROCEDURE IF EXISTS `sp_EditarEmpleado`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_EditarEmpleado`(
    codper VARCHAR(9), ape VARCHAR(45), nom VARCHAR(45), tipodni VARCHAR(15), dni VARCHAR(20), fechanac DATE,
    fechaing DATE, fechacar DATE, mail VARCHAR(50),
    codpersup VARCHAR(9), codperfun VARCHAR(9),
    codpa CHAR(3), codar VARCHAR(9), codofi VARCHAR(9), codcar VARCHAR(9), codperf VARCHAR(9), motivo INT)
BEGIN
  DECLARE descmotivo VARCHAR (100);
  DECLARE cargoactual VARCHAR (9);
  DECLARE altacargo INT;
  DECLARE existeCuenta VARCHAR (9);

  UPDATE personal
  SET
      tipodi = CONVERT(tipodni USING latin1) COLLATE latin1_spanish_ci,
      di = CONVERT(dni USING latin1) COLLATE latin1_spanish_ci,
      nombres = CONVERT(nom USING latin1) COLLATE latin1_spanish_ci,
      apellidos = CONVERT(ape USING latin1) COLLATE latin1_spanish_ci,
      fechanacimiento = CONVERT(fechanac USING latin1) COLLATE latin1_spanish_ci,
      fechaingreso = CONVERT(fechaing USING latin1) COLLATE latin1_spanish_ci,
      email = CONVERT(mail USING latin1) COLLATE latin1_spanish_ci,
      codpersonalsuperior = CONVERT(codpersup USING latin1) COLLATE latin1_spanish_ci,
      codpersonalfuncional = CONVERT(codperfun USING latin1) COLLATE latin1_spanish_ci,
      codpais = CONVERT(codpa USING latin1) COLLATE latin1_spanish_ci,
      codarea = CONVERT(codar USING latin1) COLLATE latin1_spanish_ci,
      codoficina = CONVERT(codofi USING latin1) COLLATE latin1_spanish_ci
  WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci;

  
  UPDATE perfilespersonal
  SET
      codperfil = CONVERT(codperf USING latin1) COLLATE latin1_spanish_ci
  WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci;

  SET existeCuenta = (SELECT codpersonal FROM usuarios WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci);
  

  -- SI EL EMPLEADO TIENE UN EMAIL REGISTRADO, MODIFICO LA TABLA USUARIOS
  -- EN CASO CONTRARIO REGISTRO EL USURIO, SI Y SOLO SI, INGRESO UN EMAIL
  IF existeCuenta IS NOT NULL and mail <> '' THEN
    UPDATE usuarios
    SET
        nombres = CONVERT(nom USING latin1) COLLATE latin1_spanish_ci,
        apellidos = CONVERT(ape USING latin1) COLLATE latin1_spanish_ci,
        email = CONVERT(mail USING latin1) COLLATE latin1_spanish_ci,
        activo = 1
    WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci;
  ELSEIF existeCuenta IS NULL AND mail <> '' THEN
      VALUES (codper, nom, ape, mail, '', 1);
  END IF;
  

  

  -- SI ES UNA MODIFICACION DEL CARGO, ASIGNO UNA FECHA FECHA DE BAJA A LA TABLA PERSONALCARGOS E INGRESO UN NUEVO REGISTRO
  -- A LA TABLA PERSONALCARGOS
  -- SI UNA CORRECION DE DATOS, MODIFICO EL REGISTRO CORRESPONDIENTE EN LA TABLA PERSONALCARGOS


  SET descmotivo = (SELECT descripcion FROM motivos WHERE idmotivo = CONVERT(motivo USING latin1) COLLATE latin1_spanish_ci);

  IF descmotivo = 'MODIFICACION DEL CARGO' THEN
    SET cargoactual =  (SELECT codcargo
                        FROM personalcargos WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci
                        AND fechabaja IS NULL
                        LIMIT 1);
    UPDATE personalcargos
    SET
        fechabaja = CONVERT(fechacar USING latin1) COLLATE latin1_spanish_ci,
        idmotivo = CONVERT(motivo USING latin1) COLLATE latin1_spanish_ci
    WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci
        AND codcargo = cargoactual;
        
    IF ROW_COUNT > 0 THEN
        SET altacargo = (SELECT idmotivo FROM motivos WHERE descripcion = 'ALTA DEL CARGO');
        VALUES (codper, codcar, fechacar, NULL, altacargo);
    END IF;

  ELSEIF descmotivo = 'CORRECCION DE DATOS' THEN
    
    UPDATE personalcargos
    SET
        codcargo = CONVERT(codcar USING latin1) COLLATE latin1_spanish_ci,
        fechaalta = CONVERT(fechacar USING latin1) COLLATE latin1_spanish_ci,
        idmotivo = CONVERT(motivo USING latin1) COLLATE latin1_spanish_ci
    WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci 
      AND codcargo = CONVERT(codcar USING latin1) COLLATE latin1_spanish_ci;

  END IF;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_EditarPlanificacion`
--

DROP PROCEDURE IF EXISTS `sp_EditarPlanificacion`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_EditarPlanificacion`(
Codigo CHAR(14), CodPlanificacion CHAR(20), CodObjetivos VARCHAR(1000),
Objetivos VARCHAR(1000), Actividades VARCHAR(1000), Cronogramas VARCHAR(255), Metas VARCHAR(1000),
Pesos VARCHAR(100), CodAcciones VARCHAR(1000), Acciones VARCHAR(1000),
CodMej CHAR(20), Mejora VARCHAR(1000), Compromiso VARCHAR(1000)
-- , OUT Mensaje VARCHAR(50)
)
BEGIN
	DECLARE codobjetivo TEXT;
  DECLARE objetivo TEXT;
	DECLARE actividad TEXT;
	DECLARE cronograma TEXT;
	DECLARE meta TEXT;
	DECLARE peso TEXT;
  DECLARE codaccion TEXT;
	DECLARE accion TEXT;
	DECLARE Delimitador CHAR(1);
	DECLARE Pos1 INT DEFAULT 1 ;
	DECLARE Pos2 INT DEFAULT 1 ;
	DECLARE Pos3 INT DEFAULT 1 ;
	DECLARE Pos4 INT DEFAULT 1 ;
	DECLARE Pos5 INT DEFAULT 1 ;
	DECLARE Pos6 INT DEFAULT 1 ;
	DECLARE Pos7 INT DEFAULT 1 ;
  DECLARE Pos8 INT DEFAULT 1 ;
  DECLARE Str1 VARCHAR(1000);
	DECLARE Str2 VARCHAR(1000);
	DECLARE Str3 VARCHAR(1000);
	DECLARE Str4 VARCHAR(1000);
	DECLARE Str5 VARCHAR(1000);
	DECLARE Str6 VARCHAR(1000);
	DECLARE Str7 VARCHAR(1000);
  DECLARE Str8 VARCHAR(1000);
  
  SET SQL_SAFE_UPDATES=0;

  SET Codigo = CONVERT(Codigo USING latin1) COLLATE latin1_spanish_ci;
  SET CodPlanificacion = CONVERT(CodPlanificacion USING latin1) COLLATE latin1_spanish_ci;
  

	SET Delimitador = '^';
  SET codobjetivo = CONVERT(CodObjetivos USING latin1) COLLATE latin1_spanish_ci;
	SET objetivo = CONVERT(Objetivos USING latin1) COLLATE latin1_spanish_ci;
	SET actividad = CONVERT(Actividades USING latin1) COLLATE latin1_spanish_ci;
	SET cronograma = CONVERT(Cronogramas USING latin1) COLLATE latin1_spanish_ci;
	SET meta = CONVERT(Metas USING latin1) COLLATE latin1_spanish_ci;
	SET peso = CONVERT(Pesos USING latin1) COLLATE latin1_spanish_ci;

  SET codaccion = CONVERT(CodAcciones USING latin1) COLLATE latin1_spanish_ci;
	SET accion = CONVERT(Acciones USING latin1) COLLATE latin1_spanish_ci;

  SET Mejora = CONVERT(Mejora USING latin1) COLLATE latin1_spanish_ci;
	SET Compromiso = CONVERT(Compromiso USING latin1) COLLATE latin1_spanish_ci;


  UPDATE mejoras SET mejora = Mejora,
      compromiso = Compromiso
  WHERE codmejora = CONVERT(CodMej USING latin1) COLLATE latin1_spanish_ci;

   
  SET @codplanificacion = CodPlanificacion;
  SET @existeObjetivo = NULL;
  SET @objetivosNoEliminados = '';
  
  SET @existeAccion = NULL;
  SET @accionesNoEliminadas = '';

  PREPARE verificarExisteObjetivo FROM 'SELECT COUNT(*) INTO @existeObjetivo FROM objetivos WHERE codobjetivo = ?';

  PREPARE actualizarObjetivo FROM 'UPDATE objetivos SET objetivo = ?,
               actividad = ?,
               cronograma = ?,
               meta = ?,
               pesorelativo = ?
           WHERE codobjetivo = ?';

  PREPARE insertarObjetivo FROM 'INSERT INTO objetivos (codobjetivo, objetivo, actividad, cronograma, meta, pesorelativo, codplanificacion)
			VALUES (?, ?, ?, ?, ?, ?, ?)';

  PREPARE verificarExisteAccion FROM 'SELECT COUNT(*) INTO @existeAccion FROM accionespropuestas WHERE codaccion = ?';

  PREPARE actualizarAccion FROM 'UPDATE accionespropuestas SET accion = ?
          WHERE codaccion = ?';

  PREPARE insertarAccion FROM 'INSERT INTO accionespropuestas (codaccion, accion, codplanificacion)
      VALUES (?, ?, ?)';



  -- Recorro el bucle siempre y cuando haya valores en las variables de los objetivos
	WHILE CHAR_LENGTH(objetivo) > 0 AND CHAR_LENGTH(actividad) > 0 AND CHAR_LENGTH(cronograma) > 0 AND CHAR_LENGTH(meta) > 0 AND
	CHAR_LENGTH(peso) > 0 AND Pos2 > 0 AND Pos3 > 0 AND Pos4 > 0 AND
	Pos5 > 0 AND Pos6 > 0 DO
    
    SET Pos2 = INSTR(objetivo, `Delimitador`);
    SET Pos3 = INSTR(actividad, `Delimitador`);
    SET Pos4 = INSTR(cronograma, `Delimitador`);
    SET Pos5 = INSTR(meta, `Delimitador`);
    SET Pos6 = INSTR(peso, `Delimitador`);
      
    IF Pos2 = 0 AND Pos3 = 0 AND Pos4 = 0 AND Pos5 = 0 AND Pos6 = 0 THEN
  		SET Str2 = objetivo;
  		SET Str3 = actividad;
  		SET Str4 = cronograma;
  		SET Str5 = meta;
  		SET Str6 = peso;
  	ELSE
      SET Str2 = LEFT(objetivo, Pos2 - 1);
      SET Str3 = LEFT(actividad, Pos3 - 1);
   	 SET Str4 = LEFT(cronograma, Pos4 - 1);
   	 SET Str5 = LEFT(meta, Pos5 - 1);
   	 SET Str6 = LEFT(peso, Pos6 - 1);
    END IF;

    SET @objetivo = Str2;
    SET @actividad = Str3;
    SET @cronograma = STR_TO_DATE(Str4, '%d/%m/%Y');
    SET @meta = Str5;
    SET @peso = Str6;

    -- Si el codobjetivo existe, entonces no hay objetivo nuevo
    IF CHAR_LENGTH(codobjetivo) > 0 AND Pos1 > 0 THEN
      SET Pos1 = INSTR(codobjetivo, `Delimitador`);

      IF Pos1 = 0 THEN
        SET Str1 = codobjetivo;
      ELSE
        SET Str1 = LEFT(codobjetivo, Pos1 - 1);
      END IF;
      
      SET @codobjetivo = Str1;

      EXECUTE verificarExisteObjetivo USING @codobjetivo;
      IF @existeObjetivo = 1 THEN
        EXECUTE actualizarObjetivo USING @objetivo, @actividad, @cronograma, @meta, @peso, @codobjetivo;
      END IF;


      SET codobjetivo = SUBSTRING(codobjetivo, Pos1 + 1);

    -- Si el codobjetivo no existe, registra objetivo nuevo
    ELSE

      SET @codobj = ft_GenerarCodigo(Codigo, 'OB');

      EXECUTE insertarObjetivo USING @codobj, @objetivo, @actividad, @cronograma, @meta, @peso, @codplanificacion;

      SET CodObjetivos = CONCAT(CodObjetivos, '^', @codobj);



		END IF;



    SET objetivo = SUBSTRING(objetivo, Pos2 + 1);
  	SET actividad = SUBSTRING(actividad, Pos3 + 1);
  	SET cronograma = SUBSTRING(cronograma, Pos4 + 1);
  	SET meta = SUBSTRING(meta, Pos5 + 1);
  	SET peso = SUBSTRING(peso, Pos6 + 1);


	END WHILE;


  SET @objetivosNoEliminados = REPLACE(CodObjetivos, '^', ',');

  PREPARE eliminarObjetivo FROM 'DELETE FROM objetivos WHERE FIND_IN_SET(codobjetivo, ?)= 0 AND codplanificacion = ?';
  EXECUTE eliminarObjetivo USING @objetivosNoEliminados, @codplanificacion;

  DEALLOCATE PREPARE verificarExisteObjetivo;
  DEALLOCATE PREPARE actualizarObjetivo;
  DEALLOCATE PREPARE insertarObjetivo;
  DEALLOCATE PREPARE eliminarObjetivo;



	WHILE CHAR_LENGTH(accion) > 0 AND Pos8 > 0 DO

    SET Pos8 = INSTR(accion, `Delimitador`);

		IF Pos8 = 0 THEN
      SET Str8 = accion;
    ELSE
      SET Str8 = LEFT(accion, Pos8 - 1);
    END IF;

    SET @accion = Str8;

    IF CHAR_LENGTH(codaccion) > 0 AND Pos7 > 0 THEN
      SET Pos7 = INSTR(codaccion, `Delimitador`);
      
      IF Pos7 = 0 THEN
        SET Str7 = codaccion;
      ELSE
        SET Str7 = LEFT(codaccion, Pos7 - 1);
      END IF;
      
      SET @codaccion = Str7;

      EXECUTE verificarExisteAccion USING @codaccion;
      IF @existeAccion = 1 THEN
        EXECUTE actualizarAccion USING @accion, @codaccion;
      END IF;  

      SET codaccion = SUBSTRING(codaccion, Pos7 + 1);

    ELSE

      SET @codacc = ft_GenerarCodigo(Codigo, 'AC');

			EXECUTE insertarAccion USING @codacc, @accion, @codplanificacion;

      SET CodAcciones = CONCAT(CodAcciones, '^', @codacc);

    END IF;


		SET accion = SUBSTRING(accion, Pos8 + 1);
	END WHILE;

  SET @accionesNoEliminadas = REPLACE(CodAcciones, '^', ',');

  PREPARE eliminarAccion FROM 'DELETE FROM accionespropuestas WHERE FIND_IN_SET(codaccion, ?) = 0 AND codplanificacion = ?';
  EXECUTE eliminarAccion USING @accionesNoEliminadas, @codplanificacion;
  
  DEALLOCATE PREPARE verificarExisteAccion;
  DEALLOCATE PREPARE actualizarAccion;
  DEALLOCATE PREPARE insertarAccion;
  DEALLOCATE PREPARE eliminarAccion;

  -- SET @mensaje = 'Se guardó exitosamente la planificación. ';
  -- SELECT @mensaje INTO Mensaje;

-- CALL sp_EditarPlanificacion('ARG-PJ-2013','ARG-PJ-2013-PL-00001','ARG-PJ-2013-OB-00001^ARG-PJ-2013-OB-00002^ARG-PJ-2013-OB-00003', 'Objetivo1^Objetivo2^Objetivo3','Actividad1^Actividad2^Actividad3', '2013-11-27^2013-11-27^2013-11-27','Meta1^Meta2^Meta3', '25^25^50','ARG-PJ-2013-AC-00001^ARG-PJ-2013-AC-00002','Accion1^Accion2', 'ARG-PJ-2013-ME-00001','Actitud','Compromiso', 'ARG-PJ-2013-IN-00001',70,30);

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_ListarPersonalNombre`
--

DROP PROCEDURE IF EXISTS `sp_ListarPersonalNombre`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ListarPersonalNombre`(
    apellido VARCHAR(10), pais CHAR(3), empleado VARCHAR(15))
BEGIN
  IF empleado = 'subordinado' THEN
    SELECT
      CONCAT(personal.apellidos,' ', personal.nombres)personal,
      personal.codpersonal
    FROM personal
    INNER JOIN personalcargos ON personalcargos.codpersonal = personal.codpersonal
    WHERE apellidos LIKE CONVERT(CONCAT(apellido,'%') USING latin1) COLLATE latin1_spanish_ci
      AND personal.codpais LIKE CONVERT(pais USING latin1) COLLATE latin1_spanish_ci
      AND personalcargos.fechabaja IS NULL
    ORDER BY personal.apellidos, personal.nombres;
  ELSEIF empleado = 'jefe' THEN
    SELECT
      CONCAT(personal.apellidos,' ', personal.nombres)personal,
      personal.codpersonal
    FROM personal
    INNER JOIN personalcargos ON personalcargos.codpersonal = personal.codpersonal
    WHERE apellidos LIKE CONVERT(CONCAT(apellido,'%') USING latin1) COLLATE latin1_spanish_ci
    AND personalcargos.fechabaja IS NULL
    ORDER BY personal.apellidos, personal.nombres;
  END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_ListarPersonalPaginado`
--

DROP PROCEDURE IF EXISTS `sp_ListarPersonalPaginado`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ListarPersonalPaginado`(
    pais CHAR(9),
    muestraInicio INT,muestraLongitud INT, filtro VARCHAR(100),
    OUT cantRegSinFiltar INT, OUT cantReg INT )
BEGIN
--  SET @id=0;
--  SELECT @id:=@id+1 id, paginado.codpersonal, paginado.apellidos, paginado.nombres, paginado.cargo,
--        paginado.pais
--  FROM (
  SELECT SQL_CALC_FOUND_ROWS
  personal.codpersonal, personal.apellidos, personal.nombres, cargos.nombre cargo, oficinas.nombre oficina
  FROM personal
  INNER JOIN personalcargos ON personalcargos.codpersonal = personal.codpersonal
  INNER JOIN cargos ON cargos.codcargo = personalcargos.codcargo
  INNER JOIN oficinas ON oficinas.codoficina = personal.codoficina
  INNER JOIN paises ON paises.codpais = personal.codpais
  WHERE personalcargos.fechabaja IS NULL AND
  personal.codpais = CONVERT(pais USING latin1) COLLATE latin1_spanish_ci AND
  (personal.apellidos LIKE CONVERT(CONCAT('%', filtro, '%') USING latin1) COLLATE latin1_spanish_ci
  OR personal.nombres LIKE CONVERT(CONCAT('%', filtro, '%') USING latin1) COLLATE latin1_spanish_ci
  OR cargos.nombre LIKE CONVERT(CONCAT('%', filtro, '%') USING latin1) COLLATE latin1_spanish_ci
  OR paises.nombrepais LIKE CONVERT(CONCAT('%', filtro, '%') USING latin1) COLLATE latin1_spanish_ci)
  ORDER BY personal.apellidos, personal.nombres
  LIMIT muestraInicio,muestraLongitud;
--  ) paginado
--  ORDER BY paginado.apellidos, paginado.nombres;

  SELECT FOUND_ROWS() INTO cantRegSinFiltar;
  SELECT COUNT(*) 
  FROM  personal
  INNER JOIN personalcargos ON personalcargos.codpersonal = personal.codpersonal
  INNER JOIN cargos ON cargos.codcargo = personalcargos.codcargo
  INNER JOIN oficinas ON oficinas.codoficina = personal.codoficina
  INNER JOIN paises ON paises.codpais = personal.codpais
  WHERE personalcargos.fechabaja IS NULL AND personal.codpais = CONVERT(pais USING latin1) COLLATE latin1_spanish_ci INTO cantReg;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

