--
-- Definition of procedure `sp_ObtenerCargos`
--

DROP PROCEDURE IF EXISTS `sp_ObtenerCargos`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ObtenerCargos`(
    area VARCHAR(9), pais CHAR(3))
BEGIN
  SELECT cargos.codcargo, cargos.nombre cargo
  FROM cargos
  INNER JOIN areas ON areas.codarea = cargos.codarea AND areas.codpais = cargos.codpais
  WHERE cargos.codarea=CONVERT(area USING latin1) COLLATE latin1_spanish_ci
  AND cargos.codpais=CONVERT(pais USING latin1) COLLATE latin1_spanish_ci
  ORDER BY cargos.nombre;
END $$
