--
-- Definition of procedure `sp_ObtenerEmpleado`
--

DROP PROCEDURE IF EXISTS `sp_ObtenerEmpleado`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ObtenerEmpleado`(
    CodPersonal VARCHAR(9))
BEGIN
  SELECT
    personal.email,
    paises.codpais,
    paises.nombrepais pais,
    personal.codpersonal,
    personal.apellidos,
    personal.nombres,
    personal.tipodi,
    personal.di,
    CASE WHEN personal.fechanacimiento IS NULL THEN ''
      ELSE DATE_FORMAT(personal.fechanacimiento,'%d/%m/%Y') END fechanacimiento,
    DATE_FORMAT(personal.fechaingreso,'%d/%m/%Y')fechaingreso,
    DATE_FORMAT(personalcargos.fechaalta,'%d/%m/%Y')fechacargo,
    DATEDIFF(CURDATE(), personal.fechaingreso)/365 anospm,
    areas.codarea,
    areas.nombre area,
    cargos.codcargo,
    cargos.nombre cargo,
    DATEDIFF(CURDATE(), personalcargos.fechaalta)/365 anoscargo,
    oficinas.codoficina,
    oficinas.nombre oficina,
    regional.codregional,
    regional.nombre regional,
    IFNULL(SupInm.codpersonalsuperior,'') codpersonalsuperior,
    IFNULL(SupInm.apellidossuperior,'') apellidossuperior,
    IFNULL(SupInm.nombressuperior,'') nombressuperior,
    IFNULL(SupInm.cargosuperior,'') cargosuperior,
    IFNULL(SupInm.emailsuperior,'') emailsuperior,
    IFNULL(SupFun.codpersonalfuncional,'') codpersonalfuncional,
    IFNULL(SupFun.apellidosfuncional,'') apellidosfuncional,
    IFNULL(SupFun.nombresfuncional,'') nombresfuncional,
    IFNULL(SupFun.cargofuncional,'') cargofuncional,
    IFNULL(SupFun.emailfuncional,'') emailfuncional,
    nivelesjerarquicos.incidenciaobjetivo,
    nivelesjerarquicos.incidencialiderazgo,
    perfiles.codperfil grupo
  FROM personal
  INNER JOIN personalcargos ON personalcargos.codpersonal = personal.codpersonal
  INNER JOIN cargos ON cargos.codcargo = personalcargos.codcargo
  INNER JOIN areas ON areas.codpais = personal.codpais AND areas.codarea = personal.codarea
  INNER JOIN oficinas ON oficinas.codoficina = personal.codoficina
  LEFT JOIN regional ON regional.codregional = oficinas.codregional
  INNER JOIN paises ON paises.codpais = personal.codpais
  LEFT JOIN (
    SELECT p.codpersonal codpersonalsuperior, p.apellidos apellidossuperior, p.nombres nombressuperior, c.nombre cargosuperior, p.email emailsuperior
    FROM personal p
    INNER JOIN personalcargos pc ON pc.codpersonal = p.codpersonal
    INNER JOIN cargos c ON c.codcargo = pc.codcargo
    )SupInm ON SupInm.codpersonalsuperior = personal.codpersonalsuperior
  LEFT JOIN (
    SELECT pe.codpersonal codpersonalfuncional, pe.apellidos apellidosfuncional, pe.nombres nombresfuncional, ca.nombre cargofuncional, pe.email emailfuncional
    FROM personal pe
    INNER JOIN personalcargos peca ON peca.codpersonal = pe.codpersonal
    INNER JOIN cargos ca ON ca.codcargo = peca.codcargo
    )SupFun ON SupFun.codpersonalfuncional = personal.codpersonalfuncional
  INNER JOIN nivelesjerarquicos ON nivelesjerarquicos.codnivel = cargos.codnivel
  INNER JOIN perfilespersonal ON perfilespersonal.codpersonal = personal.codpersonal
  INNER JOIN perfiles ON perfiles.codperfil = perfilespersonal.codperfil
  WHERE personal.codpersonal = CONVERT(CodPersonal USING latin1) COLLATE latin1_spanish_ci
  AND personalcargos.fechabaja IS NULL;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_ObtenerEstadoPlanificacion`
--

DROP PROCEDURE IF EXISTS `sp_ObtenerEstadoPlanificacion`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ObtenerEstadoPlanificacion`(pais CHAR(3))
BEGIN
  SELECT DISTINCT CONCAT(personal.apellidos,' ',personal.nombres) nombre, paises.nombrepais pais, estadoplanificacion.estado,
  regional.nombre regional, cargos.nombre cargo, oficinas.nombre oficina, areas.nombre area,
  CONCAT(superior.apellidos,' ',superior.nombres)superior
  FROM personal
  INNER JOIN personalcargos ON personalcargos.codpersonal = personal.codpersonal
  INNER JOIN cargos ON cargos.codcargo = personalcargos.codcargo
  INNER JOIN areas ON areas.codpais = personal.codpais AND areas.codarea = personal.codarea
  INNER JOIN paises ON paises.codpais = personal.codpais
  INNER JOIN oficinas ON oficinas.codoficina = personal.codoficina
  INNER JOIN regional ON regional.codregional = oficinas.codregional
  INNER JOIN planificacion ON planificacion.codpersonal = personal.codpersonal
  INNER JOIN estadoplanificacion ON estadoplanificacion.codestado = planificacion.codestado
  LEFT JOIN (SELECT p.codpersonal, p.apellidos, p.nombres
               FROM personal p
  ) superior ON superior.codpersonal = personal.codpersonalsuperior
  WHERE planificacion.periodo=YEAR(CURDATE())  AND paises.codpais = CONVERT(pais USING latin1) COLLATE latin1_spanish_ci
  ORDER BY paises.nombrepais, personal.apellidos, personal.nombres;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_ObtenerMotivos`
--

DROP PROCEDURE IF EXISTS `sp_ObtenerMotivos`;

