--
-- Definition of procedure `sp_ObtenerOficinas`
--

DROP PROCEDURE IF EXISTS `sp_ObtenerOficinas`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ObtenerOficinas`(regional VARCHAR(9))
BEGIN
  SELECT oficinas.codoficina, oficinas.nombre oficina
  FROM oficinas
  INNER JOIN regional ON regional.codregional = oficinas.codregional
  WHERE oficinas.codregional=CONVERT(regional USING latin1) COLLATE latin1_spanish_ci
  ORDER BY oficinas.nombre;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_ObtenerPersonalCargo`
--

DROP PROCEDURE IF EXISTS `sp_ObtenerPersonalCargo`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ObtenerPersonalCargo`(
    CodPersonal VARCHAR(9))
BEGIN
SELECT
    personal.codpersonal,
    personal.apellidos,
    personal.nombres,
    IFNULL(estadoplanificacion.estado,'')estado
  FROM personal
  INNER JOIN personalcargos ON personalcargos.codpersonal = personal.codpersonal
  LEFT JOIN planificacion ON planificacion.codpersonal = personal.codpersonal
  LEFT JOIN estadoplanificacion ON estadoplanificacion.codestado = planificacion.codestado
  WHERE codpersonalsuperior=(SELECT p.codpersonal FROM personal p WHERE p.codpersonal=CONVERT(CodPersonal USING latin1) COLLATE latin1_spanish_ci)
  AND personalcargos.fechabaja IS NULL
  ORDER BY personal.apellidos, personal.nombres;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_ObtenerPlanificacion`
--

DROP PROCEDURE IF EXISTS `sp_ObtenerPlanificacion`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ObtenerPlanificacion`(
CodPersonal VARCHAR(9), fecha VARCHAR(4))
BEGIN

SELECT planificacion.codplanificacion, estadoplanificacion.estado, mejoras.codmejora, mejoras.mejora, mejoras.compromiso
FROM planificacion
INNER JOIN estadoplanificacion ON estadoplanificacion.codestado = planificacion.codestado
INNER JOIN mejoras ON mejoras.codplanificacion = planificacion.codplanificacion
WHERE planificacion.codpersonal = CONVERT(CodPersonal USING latin1) COLLATE latin1_spanish_ci
AND planificacion.periodo = CONVERT(fecha USING latin1) COLLATE latin1_spanish_ci;

SELECT objetivos.codobjetivo, objetivos.objetivo, objetivos.actividad, DATE_FORMAT(objetivos.cronograma,'%d/%m/%Y')cronograma,
       objetivos.meta, objetivos.pesorelativo
FROM planificacion
INNER JOIN objetivos ON objetivos.codplanificacion = planificacion.codplanificacion
WHERE planificacion.codpersonal = CONVERT(CodPersonal USING latin1) COLLATE latin1_spanish_ci
AND planificacion.periodo = CONVERT(fecha USING latin1) COLLATE latin1_spanish_ci;

SELECT accionespropuestas.codaccion, accionespropuestas.accion
FROM planificacion
INNER JOIN accionespropuestas ON accionespropuestas.codplanificacion = planificacion.codplanificacion
WHERE planificacion.codpersonal = CONVERT(CodPersonal USING latin1) COLLATE latin1_spanish_ci
AND planificacion.periodo = CONVERT(fecha USING latin1) COLLATE latin1_spanish_ci;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

