--
-- Definition of procedure `sp_ObtenerUsuario`
--

DROP PROCEDURE IF EXISTS `sp_ObtenerUsuario`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ObtenerUsuario`(Correo VARCHAR(100), Contrasena VARCHAR(32))
BEGIN

  SELECT usuarios.codpersonal, usuarios.nombres, usuarios.apellidos, usuarios.email, perfiles.nombreperfil perfil, personal.codpais
  FROM usuarios
  INNER JOIN personal ON personal.codpersonal = usuarios.codpersonal
  INNER JOIN perfilespersonal ON perfilespersonal.codpersonal = personal.codpersonal
  INNER JOIN perfiles ON perfiles.codperfil = perfilespersonal.codperfil
  WHERE usuarios.email=CONVERT(Correo USING latin1) COLLATE latin1_spanish_ci AND usuarios.password=CONVERT(Contrasena USING latin1) COLLATE latin1_spanish_ci
  AND activo=1
	LIMIT 1 ;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_RegistrarBaja`
--

DROP PROCEDURE IF EXISTS `sp_RegistrarBaja`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_RegistrarBaja`(
    codper VARCHAR(9), fechaba DATETIME, motivo INT)
BEGIN
  DECLARE existeCuenta VARCHAR (9);

  VALUES (codper, fechaba);

  UPDATE personalcargos
  SET
      fechabaja = CONVERT(fechaba USING latin1) COLLATE latin1_spanish_ci,
      idmotivo = CONVERT(motivo USING latin1) COLLATE latin1_spanish_ci
  WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci
  AND fechabaja IS NULL;
  
  SET existeCuenta = (SELECT codpersonal FROM usuarios WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci AND activo = 1);


  -- SI EL EMPLEADO TIENE UN EMAIL REGISTRADO, MODIFICO LA TABLA USUARIOS
  -- EN CASO CONTRARIO REGISTRO EL USURIO, SI Y SOLO SI, INGRESO UN EMAIL
  IF existeCuenta IS NOT NULL THEN
    UPDATE usuarios
    SET
        activo = 0
    WHERE codpersonal = CONVERT(codper USING latin1) COLLATE latin1_spanish_ci;
  END IF;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_RegistrarEmpleado`
--

DROP PROCEDURE IF EXISTS `sp_RegistrarEmpleado`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_RegistrarEmpleado`(
    ape VARCHAR(45), nom VARCHAR(45), tipodni VARCHAR(15), dni VARCHAR(20), fechanac DATE,
    fechaing DATE, fechacar DATE, mail VARCHAR(50),
    codpersup VARCHAR(9), codperfun VARCHAR(9),
    codpa CHAR(3), codar VARCHAR(9), codofi VARCHAR(9), codcar VARCHAR(9), codperf VARCHAR(9))
BEGIN
  DECLARE codper VARCHAR (9);
  SET codper = (SELECT CAST(SUBSTRING(codpersonal, 5, 4) AS UNSIGNED)+1 codpersonal
                 FROM personal
                 WHERE codpais=CONVERT(codpa USING latin1) COLLATE latin1_spanish_ci
                 ORDER BY codpersonal DESC
                 LIMIT 1);

      codpersonalfuncional, codpais, codarea, codoficina)
  VALUES
  (CONCAT(codpa, '-', codper), tipodni, dni, nom, ape, fechanac, fechaing, mail, codpersup, codperfun, codpa, codar, codofi);

  VALUES (CONCAT(codpa, '-', codper), codcar, fechacar, NULL);

  VALUES (codperf, CONCAT(codpa, '-', codper));

  IF mail <> '' THEN
    VALUES (CONCAT(codpa, '-', codper), nom, ape, mail, '', 1);
  END IF;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `sp_RegistrarPlanificacion`
--

DROP PROCEDURE IF EXISTS `sp_RegistrarPlanificacion`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_RegistrarPlanificacion`(
Codigo VARCHAR(20), CodPersonal VARCHAR(9), Periodo CHAR(4),
Objetivos VARCHAR(1000), Actividades VARCHAR(1000), Cronogramas VARCHAR(255),
Metas VARCHAR(1000),
Pesos VARCHAR(100), Acciones VARCHAR(1000),
Mejora VARCHAR(1000), Compromiso VARCHAR(1000)
-- , OUT CodPlanificacion VARCHAR(20),OUT Mensaje VARCHAR(50)
)
BEGIN
	DECLARE objetivo TEXT;
	DECLARE actividad TEXT;
	DECLARE cronograma TEXT;
	DECLARE meta TEXT;
	DECLARE peso TEXT;
	DECLARE accion TEXT;
	DECLARE Delimitador CHAR(1);
	DECLARE Pos1 INT DEFAULT 1 ;
	DECLARE Pos2 INT DEFAULT 1 ;
	DECLARE Pos3 INT DEFAULT 1 ;
	DECLARE Pos4 INT DEFAULT 1 ;
	DECLARE Pos5 INT DEFAULT 1 ;
	DECLARE Pos6 INT DEFAULT 1 ;
	DECLARE Str1 VARCHAR(1000);
	DECLARE Str2 VARCHAR(1000);
	DECLARE Str3 VARCHAR(1000);
	DECLARE Str4 VARCHAR(1000);
	DECLARE Str5 VARCHAR(1000);
	DECLARE Str6 VARCHAR(1000);


  SET Codigo = CONVERT(Codigo USING latin1) COLLATE latin1_spanish_ci;
  SET CodPersonal = CONVERT(CodPersonal USING latin1) COLLATE latin1_spanish_ci;

  SET Delimitador = '^';
	SET objetivo = CONVERT(Objetivos USING latin1) COLLATE latin1_spanish_ci;
	SET actividad = CONVERT(Actividades USING latin1) COLLATE latin1_spanish_ci;
	SET cronograma = CONVERT(Cronogramas USING latin1) COLLATE latin1_spanish_ci;
	SET meta = CONVERT(Metas USING latin1) COLLATE latin1_spanish_ci;
	SET peso = CONVERT(Pesos USING latin1) COLLATE latin1_spanish_ci;
	SET accion = CONVERT(Acciones USING latin1) COLLATE latin1_spanish_ci;
  
  SET Mejora = CONVERT(Mejora USING latin1) COLLATE latin1_spanish_ci;
	SET Compromiso = CONVERT(Compromiso USING latin1) COLLATE latin1_spanish_ci;


  SET @CodPlanificacion = (SELECT ft_GenerarCodigo(Codigo, 'PL'));


   PREPARE insertarObjetivo FROM 'INSERT INTO objetivos (codobjetivo, objetivo, actividad, cronograma, meta, pesorelativo, codplanificacion)
			VALUES (?, ?, ?, ?, ?, ?, ?)';
      
   PREPARE insertarAccion FROM 'INSERT INTO accionespropuestas (codaccion, accion, codplanificacion)
      VALUES (?, ?, ?)';

	WHILE CHAR_LENGTH(objetivo) > 0 AND CHAR_LENGTH(actividad) > 0 AND CHAR_LENGTH(cronograma) > 0 AND CHAR_LENGTH(meta) > 0 AND
	CHAR_LENGTH(peso) > 0 AND Pos1 > 0 AND Pos2 > 0 AND Pos3 > 0 AND
	Pos4 > 0 AND Pos5 > 0 DO
		SET Pos1 = INSTR(objetivo, `Delimitador`);
		SET Pos2 = INSTR(actividad, `Delimitador`);
		SET Pos3 = INSTR(cronograma, `Delimitador`);
		SET Pos4 = INSTR(meta, `Delimitador`);
		SET Pos5 = INSTR(peso, `Delimitador`);
	
		IF Pos1 = 0 AND Pos2 = 0 AND Pos3 = 0 AND Pos4 = 0 AND Pos5 = 0 THEN
			SET Str1 = objetivo;
			SET Str2 = actividad;
			SET Str3 = cronograma;
			SET Str4 = meta;
			SET Str5 = peso;
		ELSE
			SET Str1 = LEFT(objetivo, Pos1 - 1);
			SET Str2 = LEFT(actividad, Pos2 - 1);
			SET Str3 = LEFT(cronograma, Pos3 - 1);
			SET Str4 = LEFT(meta, Pos4 - 1);
			SET Str5 = LEFT(peso, Pos5 - 1);
		END IF;
    
    SET @objetivo = Str1;
    SET @actividad = Str2;
    SET @cronograma = STR_TO_DATE(Str3, '%d/%m/%Y');
    SET @meta = Str4;
    SET @peso = Str5;

		IF TRIM(Str1) != '' AND TRIM(Str2) != '' AND TRIM(Str3) != '' AND TRIM(Str4) != '' AND TRIM(Str5) != '' THEN

      SET @codobj = ft_GenerarCodigo(Codigo, 'OB');

      EXECUTE insertarObjetivo USING @codobj, @objetivo, @actividad, @cronograma, @meta, @peso, @codplanificacion;


		END IF;

		SET objetivo = SUBSTRING(objetivo, Pos1 + 1);
		SET actividad = SUBSTRING(actividad, Pos2 + 1);
		SET cronograma = SUBSTRING(cronograma, Pos3 + 1);
		SET meta = SUBSTRING(meta, Pos4 + 1);
		SET peso = SUBSTRING(peso, Pos5 + 1);
	END WHILE;
  
  DEALLOCATE PREPARE insertarObjetivo;
	
	WHILE CHAR_LENGTH(accion) > 0 AND Pos6 > 0 DO
		SET Pos6 = INSTR(accion, `Delimitador`);
		IF Pos6 = 0 THEN
			SET Str6 = accion;
		ELSE
			SET Str6 = LEFT(accion, Pos6 - 1);
		END IF;

    SET @accion = Str6;

		IF TRIM(Str6) != '' THEN

      SET @codacc = ft_GenerarCodigo(Codigo, 'AC');

			EXECUTE insertarAccion USING @codacc, @accion, @codplanificacion;
		END IF;

		SET accion = SUBSTRING(accion, Pos6 + 1);
	END WHILE;
  
  DEALLOCATE PREPARE insertarAccion;

--   SET @mensaje = 'Se guardó exitosamente la planificación';
--   SELECT @CodPlanificacion INTO CodPlanificacion;
--   SELECT @mensaje INTO Mensaje;

-- CALL sp_RegistrarPlanificacion('ARG-GJ-2014','ARG-176','Objetivo1^Objetivo2^Objetivo3','Actividad1^Actividad2^Actividad3','06/01/2014^06/01/2014^06/01/2014','Meta1^Meta2^Meta3','25^25^50','Accion1^Accion2','Actitud','Compromiso');

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;



